开始tutorial! 使用链接脚本指定程序内存布局 一般来说，一个程序按照功能不同会分为下面这些段： .text 段，即代码段，存放代码 出错时候的eip往往在这个段.指向某一条语句.以此来定位问题； .rodata 段，即只读数据段，顾名思义里面存放只读数据，通常是程序中的常量； .data 段，存放被初始化的可读写数据，通常保存程序中的全局变量； .bss 段，存放被初始化为 00 的可读写数据，与 .data 段的不同之处在于我们知道它要被初始化为 00 ，因此在可执行文件中只需记录这个段的大小以及所在位置即可，而不用记录里面的数据。 stack ，即栈，用来存储程序运行过程中的局部变量，以及负责函数调用时的各种机制。它从高地址向低地址增长； heap ，即堆，用来支持程序运行过程中内存的动态分配，比如说你要读进来一个字符串，在你写程序的时候你也不知道它的长度究竟为多少，于是你只能在运行过程中，知道了字符串的长度之后，再在堆中给这个字符串分配内存。 链接脚本示例: SECTIONS
{
. = 0x10000;
.text : { *(.text) }
. = 0x8000000;
.data : { *(.data) }
.bss : { *(.bss) }
} . 表示起始地址 如果没有这个地址，默认该符号的值为0 .text : { *(.text) } : 将所有(*符号代表任意输入文件)文件的.text section合并成一个.text section,该section的地址由定位器符号的值指定, 即0x10000. . = 0x8000000 ：把定位器符号置为0x8000000 .data : { *(.data) } : 同上 .bss : { *(.bss) } : 同上 其他命令 ENTRY(SYMBOL) :将符号SYMBOL的值设置成入口地址。 INCLUDE filename : 包含其他名为filename的链接脚本 INPUT(files): 将括号内的文件做为链接过程的输入文件 GROUP(files) : 指定需要重复搜索符号定义的多个输入文件 OUTPUT(FILENAME) : 定义输出文件的名字 SEARCH_DIR(PATH) ：定义搜索路径， OUTPUT_ARCH() : 设置输出文件的体系结构
